-- ----------------------------
-- Table structure for ade_dictionary
-- ----------------------------
DROP TABLE IF EXISTS `ade_dictionary`;
CREATE TABLE `ade_dictionary` (
`id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'id编码' ,
`dict_name`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '字典名称' ,
`dict_code`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '字典code值' ,
`dict_type`  varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '数据字典类型，1：用户字典，8：系统字典' ,
`dict_sort`  int(11) NULL DEFAULT NULL COMMENT '字典排序' ,
`dict_desc`  varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字典描述信息' ,
`dict_status`  varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否使用，1：使用，9：不使用' ,
`dict_pid`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '父节点ID编码' ,
`dict_value`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '数据字典的值，可以用来组成配置项' ,
PRIMARY KEY (`id`),
INDEX `FK_aspw4dddw92f8box1s3olp8ku` (`dict_pid`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

;

