-- ----------------------------
-- Table structure for ade_module
-- ----------------------------
DROP TABLE IF EXISTS `ade_module`;
CREATE TABLE `ade_module` (
`ID`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'ID编码' ,
`MODULE_DESC`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '模块描述' ,
`MODULE_ICON`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '模块图标' ,
`MODULE_NAME`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模块名称' ,
`MODULE_SORT`  int(11) NULL DEFAULT NULL COMMENT '模块排序' ,
`MODULE_URL`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '模块访问路径' ,
`MODULE_PID`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '该模块父节点ID编码' ,
`MODULE_TYPE`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限类型：0、菜单；1、权限' ,
`MODULE_GROUND`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模块维度(前台还是后台)；数据来源为数据字典：ade_module_ground' ,
PRIMARY KEY (`ID`),
