INSERT INTO `eg_content` VALUES ('1EEA735A7C5F46EDAD176EFD7C7DAB66', '77AF295BBB4C42F49FDC2CDB21EC5CFB', '视频网站', '', '', '', '0', '', null, '1', '', '', '0', null, '0', '2017-08-15 16:05:25'), ('28B11D44F01642899A398E257D148B04', '1', '777', '', '', '', '0', '', null, '1', '', '', '0', '2017-08-15 11:26:41', null, null), ('38C5355DD2754B40A11CF50CD2CA599C', '1', '测试标题', '测试标题', '', '', '0', '', null, '0', '&lt;img src=&quot;/ade3demo/demo/kindEditorFileManagerController/img?f=%5Cimage%5C38%5CC5%5C35%5C38C5355DD2754B40A11CF50CD2CA599C%5C1702bcee-7594-4be9-8791-f914578bcd48.jpg&quot; alt=&quot;&quot; /&gt;这里是一些文章的简要信息。', '', '0', '2017-08-17 11:30:03', null, null), ('65F8942A50AB4CEEB1F52278EC3F9E1E', '1', '附件测试', '', '', '', '0', '', null, '0', '', '', '0', '2017-08-17 13:26:06', null, null), ('76C4B9E192994F5E9780E9E2BA87C804', '77AF295BBB4C42F49FDC2CDB21EC5CFB', '视频2', '', '', '', '0', '', null, '0', '', '', '0', '2017-08-15 16:05:12', null, null), ('7708C0AD36BE4FC8BC1548BD2FCF8839', '1', '55555', '', '', '', '0', '', null, '0', '', '', '0', '2017-08-15 11:26:36', null, null), ('91DD09CED87946BD8B301D5A26DB2E20', '1', '从站起来到强起来:中国共产党引领伟大复兴', '', '', '', '0', '', null, '0', '<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	“我们一定不负重托，不辱使命。”这是习近平总书记上任伊始作出的庄严承诺。五年过去，中国发展站到新的历史起点上，中国特色社会主义进入新的发展阶段，实现了从站起来、富起来到强起来的历史性飞跃，世界越来越看好中国。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　如今，中国临近“两个一百年”目标的历史交汇点。关键当口，继续引领历经沧<img src=\"/ade3demo/demo/kindEditorFileManagerController/img?f=%5Cimage%5C91%5CDD%5C09%5C91DD09CED87946BD8B301D5A26DB2E20%5C18514f75-b6b8-4ed3-bd10-74c13f0bef5b.jpg\" alt=\"\" />桑的东方大国走向复兴，成为习近平和中国共产党人的历史使命。\r\n</p>\r\n<p align=\"center\" style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	<strong>一、这五年我们办成了不少大事，我国发展站到新的历史起点上</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　这五年是“党和国家发展进程中很不平凡的5年”，习近平的话让人深有感触。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　首艘国产航母下水、国产大型客机C919成功首飞、“天眼”探空、“蛟龙”入海、“墨子号”发射升空……五年间，一系列“国之重器”让世界刮目相看。<strong>这些激动人心的场景，让中国人的信心和梦想被不断点燃。</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　而改革发展稳定、内政外交国防、治党治国治军等各方面，在习近平的领导下，取得了历史性成就和变革。五年来，党中央推出一系列重大战略举措，出台一系列重大方针政策，推进一系列重大工作，解决了许多长期想解决而没有解决的难题，办成了许多过去想办而没有办成的大事。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　“环顾世界，没有一个国家能像当今中国这样，以一种说到做到、只争朝夕的方式推进改革。”对这场变革，有外媒如此评价。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　认清历史方位，才能看清前行的方向。<strong>近代以来，</strong>&nbsp;<strong>从落后挨打到新中国成立“站起来”、改革开放“富起来”再到“强起来”，我们经历了很多大风大浪。如今，民族复兴的接力棒交到了我们这一代人的手上。</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　习近平强调，“即将召开的党的十九大，是在全面建成小康社会决胜阶段、中国特色社会主义发展关键时期召开的一次十分重要的大会。”而大会选出的新一届中央委员会，将承担收官第一个百年奋斗目标、开启第二个百年奋斗目标的历史重任。\r\n</p>\r\n<p align=\"center\" style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	<strong>二、站到新的历史起点，要有正确的方向，要有新的精神状态和奋斗姿态</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　越是接近梦想实现，越要头脑清醒、居安思危。新的历史起点上，“怎么看、怎么干”就变得极为重要。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　道路决定命运，道路就是党的生命。对中国这样的大国来说，尤其如此。经过党带领人民近百年的持续奋斗，现在，我们前所未有地靠近世界舞台中心。<strong>路走对了，就不怕遥远。</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　“中国特色社会主义是改革开放以来党的全部理论和实践的主题”，这是习近平作出的明确判断。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　“全党必须高举中国特色社会主义伟大旗帜，牢固树立中国特色社会主义道路自信、理论自信、制度自信、文化自信，确保党和国家事业始终沿着正确方向胜利前进。”这是习近平对于全党的明确要求。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　<strong>中国特色社会主义进入了新的发展阶段，需要解决新的问题。</strong>&nbsp;一方面，经过改革开放近40年的发展，我国社会生产力水平明显提高；人民生活显著改善，对美好生活的向往更加强烈，人民群众的需要呈现多样化多层次多方面的特点。另一方面，面临的风险挑战不少，地区发展还很不平衡，仍有4000多万贫困人口没有脱贫，污染治理和生态问题突出，发展的短板不少。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　如何应对挑战？就是要直面问题，不回避、不绕开。我们看到，五年来，习近平始终坚持问题导向，解决了一大批老百姓反映强烈、期盼解决的问题。接下来，决胜全面小康社会，他强调，<strong>特别要打好防范化解重大风险、精准脱贫、污染防治这“三大攻坚战”</strong>&nbsp;，坚定不移深化供给侧结构性改革，推动经济社会持续健康发展。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	<img src=\"/ade3demo/demo/kindEditorFileManagerController/img?f=%5Cimage%5C91%5CDD%5C09%5C91DD09CED87946BD8B301D5A26DB2E20%5C000b10f8-f65b-46cd-8f03-1d89a95d262f.jpg\" alt=\"\" /> \r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	　　<strong>挑战面前，也要有底线思维。</strong>&nbsp;增强忧患意识、亮明底线，才能作出准确研判，及时采取应对之策。正如习近平所言，要“看到形势发展变化给我们带来的风险，从最坏处着眼，\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	做最充分的准备，朝好的方向努力，争取最好的结果”。\r\n</p>', '', '0', '2017-08-17 11:39:09', null, null), ('9EAD196252EE4F7E84B575B87921DE42', '1', '8999999', '', '', '', '0', '', null, '9', '', '', '0', '2017-08-15 11:26:47', null, null), ('CB19B80914494E42AC6FE4392E7D1FD8', '1', '内容', '', '', '', '0', '', null, '1', '', '', '0', '2017-08-15 15:55:44', null, null);
COMMIT;

